INSERT INTO `or_lang` VALUES (20000,'y',-1,'default_text','os_long_description','Please activate cookies and javascript. You cannot participate if your haven\'t activated them. <BR><BR>\r\n\r\nPlease note, that when you click on \"Start Experiment\", you have to finish it. You cannot start it again. It is not allowed to participate twice.<BR><BR>','Bitte stellen Sie sicher, dass Cookies und Javascript in Ihrem Browser aktiviert sind. Die Teilnahme am Experiment setzt die Aktivierung beider voraus. Wenn Sie beides aktiviert haben, laden Sie diese Seite neu.<BR><BR>\r\n\r\nBitte beachten Sie, dass Sie das Experiment vollständig absolvieren müssen, wenn Sie auf den Startlink unten geklickt haben. Sie können nicht noch einmal starten. Eine Mehrfachbeteiligung ist nicht möglich.<BR><BR>'),(20001,'y',-1,'default_text','os_short_description','To participate at this experiment you need approximately 15 minutes of time. You can earn between $4 and $15.','Für die Teilnahme an diesem Experiment brauchen Sie ungefähr 15 Minuten Zeit. Der Verdienst beträgt zwischen 5 und 15 Euro.'),(70001,'y',-1,'experiment_type','2','Internet experiments','Internet-Experimente'),(70000,'y',-1,'experiment_type','1','Laboratory experiments','Laborexperimente'),(130194,'y',-1,'lang','delete_experiment_type','Delete experiment type','Experimenttyp löschen'),(80000,'y',-1,'faq_answer','1','When you receive an email invitation for an experiment, you will have to follow the link, choose a session and confirm your participation in order to be signed up for the experiment. After signing up, you will receive a confirmation e-mail with your session details.\r\n<BR><BR>\r\nHowever, once you are signed up for a session, we expect that you show up.  For details about \"Canceling a session sign-up\" please read the corresponding FAQ.','Wenn wir Sie für ein Experiment einladen, können Sie an dem Experiment nur teilnehmen, wenn Sie ausdrücklich zusagen. Eine Zusage von Ihnen erfolgt durch Anklicken des Links in der Einladungsemail und die Auswahl eines unter verschiedenen freien Terminen. Nach der Zusage erhalten Sie noch einmal eine Bestätigungsmail mit den Daten des Termins.\r\n<BR><BR>\r\nNachdem Sie jedoch für einen Termin zugesagt haben, sollten Sie auch auf jeden Fall kommen. Zum Thema \"Abmeldung\" lesen Sie bitte die dementsprechende FAQ.'),(80001,'y',-1,'faq_answer','2','Anyone who is interested in participating in experiments can apply for a subject account. However, to participate in laboratory experiments, you should be able to come to our laboratory.\r\n','Jeder Interessierte kann sich für die Teilnahme an Experimenten registrieren. Um an Laborexperimenten teilzunehmen, sollte es Ihnen aber natürlich möglich sein, zu unserem Labor zu kommen.'),(80002,'y',-1,'faq_answer','3','No, never do that. Your information is a crucial element of the experimental research. You will not be allowed to participate in an experiment if your profile or part thereof is found to be incorrect. In case you do not want to provide certain information about yourself, just leave the field blank. Note, however, that providing information will increase the probablility to be invited in experiments which target specific characteristics.','Bitte vermeiden Sie falsche Informationen bei der Anmeldung. Diese Informationen sind für die wissenschaftliche Auswertung der Experimente entscheidend. Weiterhin werden Sie nicht zu Experimenten eingeladen, wenn wir herausfinden, dass die von Ihnen zur Verfügung gestellten Informationen nicht korrekt sind. Wenn Sie bestimmte Dinge nicht angeben wollen, lassen Sie die entsprechenden Felder einfach frei. Jedoch erhöht sich die Chance, für ein Experiment eingeladen zu werden, durch zusätzliche Informationen.'),(80003,'y',-1,'faq_answer','4','Almost all experiments consist of several sessions. You can only sign up for <B>one</B> session of a particular experiment. If you are signed up, the otrher sessions will disappear from the list.\r\n\r\n<BR>As a rule of thumb: You will receive one invitation email for each experiment you are eligible for.','Fast alle Experimente werden an verschiedenen Terminen durchgeführt. Natürlich kan man sich nur für einen Termin pro Experiment anmelden. Die anderen Termine verschwinden dann aus der Liste.\r\n\r\n<BR> Wie auch immer, man erhält für jedes Experiment, für das man sich anmelden kann, eine extra E-Mail. Im allgemeinen gilt also: Pro Einladungsmail ist eine Anmeldung möglich.'),(80004,'y',-1,'faq_answer','5','There is no possibility which allows you to cancel your session signup yourself.<BR>\r\nSo please make sure that you are available for an experiment session BEFORE you sign up for it.<BR>\r\nHowever, if you become sick or are not able to attend the session due to some unforeseen circumstances, just reply to your invitation/confirmation e-mail AS SOON AS POSSIBLE and provide reasons. We will then take you off the list.','Eine Abmeldung für ein Experiment ist grundsätzlich nicht vorgesehen. <BR>Sie müssen prüfen, ob Sie für ein Experiment verfügbar sind, BEVOR Sie sich für einen Termin registrieren.<BR><BR>\r\nWenn Sie krank werden oder wegen aussergewöhnlichen Umständen nicht kommen können, antworten Sie bitte SO FRÜH WIE MÖGLICH auf Ihre Einladungs-E-Mail und legen Sie Ihre Gründe dar. Wir werden Sie dann abmelden.'),(80005,'y',-1,'faq_answer','6','For most experiments we only invite a random subset out of all participants. We do that to ensure that not always the same people participate in our experiments.<BR><bR>\r\nSometimes, we only invite participants which meet certain characteristics, for example people who have not participated in some particular previous experiments.<BR><BR>\r\nAs a result, it is possible that you see experiment sessions in the calendar but you are not eligible to enrol. However, if not enough participants are signing up for these sessions, we may send out invitations to more participants.<BR><BR>\r\nAlso, make sure that your participant profile is up-to-date, so we know your details and can invite you when you are eligible. ','Für die meisten Experimente laden wir immer nur eine zufällige Auswahl aus allen Teilnehmern ein. Damit wollen wir sicherstellen, dass nicht immer die gleichen Teilnehmer, die am häufigsten ihre E-Mail lesen, sich zu den Experimenten anmelden.<BR><BR>\r\nAndererseits laden wir manchmal nur ganz bestimme Teilnehmer ein, z.B. nur solche, die an anderen Experimenten vorher nicht teilgenommen habern.\r\n<BR><BR>\r\nDaher kann es kommen, dass Sie im Kalender Experimente sehen, zu denen Sie jedoch leider nicht eingeladen sind. Wenn sich dort jedoch nicht genug Teilnehmer anmelden, kann es gut sein, dass wir noch  Einladungen an weitere Teilnehmer verschicken.'),(80006,'y',-1,'faq_answer','7','After conducting an experiment we need some time to update the recruitment database. If the experimenter has not filled in the participation data yet, there will be the three question marks as your \"show-up\" status for the experiment. Once the data is entered, the status will change to either \"yes\" or \"no\".','Nach einem Experiment brauchen wir etwas Zeit, um die Teilnahmedaten in die Datenbank einzutragen. Solange der Experimentator diese Daten noch nicht eingetragen hat, erscheinen die drei Fragezeichen als Teilnahmestatus hinter dem Experiment. Wurden die Daten dann eingetragen, ändert sich dieser zu \"ja\" oder \"nein\".'),(80007,'y',-1,'faq_answer','8','Your payment in each experiment generally depends on your decisions and the decisions of the other participants. We do not provide information about the exact range and expected average payoff.\r\n<BR><BR>\r\nAdditionally to your experiment payoff, all participants who show up on time receive a show-up fee of EUR 2.50 Euro.','Grundsätzlich gibt es für jedes Experiment eine Vergütung. Die Höhe der Vergütung hängt aber von Ihren Entscheidungen und den Entscheidungen der anderen Teilnehmer ab. Über den genauen\r\nErwartungswert und die Unter- und Obergrenze geben wir jedoch keine Auskünfte. \r\n<BR><BR>\r\nZusätzlich zu dieser Vergütung erhält jeder Teilnehmer 2.50 Euro für\'s pünktliche Erscheinen.'),(90003,'y',-1,'faq_question','4','I signed up for an experiment, but cannot sign up for all the other experiments now, since they just disappeared!','Ich habe mich für ein Experiment angemeldet, aber kann mich jetzt nicht mehr für die anderen anmelden, da diese verschwunden sind.'),(90004,'y',-1,'faq_question','5','How can I cancel my registration for an experiment?','Wie kann ich mich für ein Experiment wieder abmelden?'),(90005,'y',-1,'faq_question','6','I see that there are sessions with free places in the calendar, so why can\'t I sign up for these sessions?','Im Kalender stehen Experimenttermine mit freien Plätzen. Warum kann ich mich dafür nicht anmelden?'),(90006,'y',-1,'faq_question','7','What is the meaning of the three question marks \"???\" next to an experiment in the list \"Experiments you participated in\"?','Was bedeuten die drei Fragezeichen \"???\" bei einem Experiment unter \"Alte Experimente\"?'),(90007,'y',-1,'faq_question','8','Do you pay me for participating in experiments? How much?','Wird die Teilnahme an den Experimenten vergütet? Und wieviel verdient man?'),(90000,'y',-1,'faq_question','1','Do I have to show up when I am invited to an experiment?','Muss ich auf jeden Fall erscheinen, wenn ich für ein Experiment eingeladen werde?'),(90001,'y',-1,'faq_question','2','Who can apply for a subject account?','Wer kann sich für die Teilnahme registrieren?'),(90002,'y',-1,'faq_question','3','Should I put in fake information when creating a subject account?','Soll ich falsche Informationen bei der Registrierung angeben?'),(100000,'y',-1,'field_of_studies','0','-','-'),(100001,'y',-1,'field_of_studies','1026776321','Business Administration','Betriebswirtschaftslehre'),(100002,'y',-1,'field_of_studies','1026776653','Economics','Volkswirtschaftslehre'),(100003,'y',-1,'field_of_studies','1026776859','Biology','Biologie'),(100004,'y',-1,'field_of_studies','1026776873','Chemistry','Chemie'),(100005,'y',-1,'field_of_studies','1026776917','Engineering','Ingenieurwissenschaften'),(100006,'y',-1,'field_of_studies','1026777019','Philosophy','Philosophie'),(100007,'y',-1,'field_of_studies','1026777042','Psychology','Psychologie'),(100008,'y',-1,'field_of_studies','1026777075','Physics','Physik'),(100009,'y',-1,'field_of_studies','1029588041','Law','Jura'),(100010,'y',-1,'field_of_studies','1034093642','History','Geschichte'),(100011,'y',-1,'field_of_studies','1034093704','English Language and Literature Studies (Britain/America)','Anglistik/Amerikanistik'),(100012,'y',-1,'field_of_studies','1034093846','Archaeology','Archäologie'),(100013,'y',-1,'field_of_studies','1034093891','German Language and Literature Studies','Germanistik'),(100014,'y',-1,'field_of_studies','1034093998','Biochemistry','Biochemie'),(100015,'y',-1,'field_of_studies','1034094011','Bioinformatics','Bioinformatik'),(100016,'y',-1,'field_of_studies','1034094105','Nutrition science','Ernährungswissenschaft'),(100017,'y',-1,'field_of_studies','1034094144','Educational science','Erziehungswissenschaft'),(100018,'y',-1,'field_of_studies','1034094168','Theology','Theologie'),(100019,'y',-1,'field_of_studies','1034094197','Geography','Geographie'),(100020,'y',-1,'field_of_studies','1034094243','Roman Languages and Literature Studies','Romanistik'),(100021,'y',-1,'field_of_studies','1034094282','Geology','Geologie'),(100022,'y',-1,'field_of_studies','1034094314','Philology','Philologie (lateinisch/griechisch)'),(100023,'y',-1,'field_of_studies','1034094353','Computer Science','Informatik'),(100024,'y',-1,'field_of_studies','1034094370','Commercial Information Technology','Wirtschaftsinformatik'),(100025,'y',-1,'field_of_studies','1034094406','Indogerman Languages','Indogermanistik'),(100026,'y',-1,'field_of_studies','1034094464','History of art','Kunstgeschichte'),(100027,'y',-1,'field_of_studies','1034094532','Mathematics','Mathematik'),(100028,'y',-1,'field_of_studies','1034094556','Media science','Medienwissenschaft'),(100029,'y',-1,'field_of_studies','1034094604','Musicology','Musikwissenschaft'),(100030,'y',-1,'field_of_studies','1034094671','Slavic Languages and Literature','Slawistik'),(100031,'y',-1,'field_of_studies','1034094702','Pharmaceutics','Pharmazie'),(100032,'y',-1,'field_of_studies','1034094754','Political Science','Politikwissenschaft'),(100033,'y',-1,'field_of_studies','1034094834','Sociology','Soziologie'),(100034,'y',-1,'field_of_studies','1034094865','Sports science','Sportwissenschaft '),(100035,'y',-1,'field_of_studies','1034094918','Prehistory and early history','Ur- und Frühgeschichte'),(100036,'y',-1,'field_of_studies','1034095015','Dentistry','Zahnmedizin'),(100037,'y',-1,'field_of_studies','1043883541','Medical technology','Medizintechnik'),(100038,'y',-1,'field_of_studies','1077147407','Anthropology','Anthropologie'),(140001,'y',-1,'mail','admin_mail_footer','-------\r\nThis E-Mail was sent to you by the recruitment system of FoobarLab at Foobar University.\r\n\r\nLog in under\r\nhttp://orsee.foorbar.edu/admin\r\n\r\nThe Online Recruitment System for Economic Experiments\r\nhttp://www.orsee.org\r\n\r\n-----','-------\r\nDiese E-Mail wurde an Sie automatisch aus dem Experiment-Teilnehmer-System des FoobarLab an der Foobar Universität verschickt.\r\n\r\nSie koennen sich einloggen unter:\r\nhttp://orsee.foorbar.edu/admin\r\n\r\nDas Online-Rekrutierungs-System für Ökonomische Experimente\r\nhttp://www.orsee.org\r\n\r\n-----'),(140003,'y',-1,'mail','admin_registration_notice','The enrolment deadline expired for\r\n\r\nExperiment #experiment_name#\r\nSession #session_name#\r\n\r\nCurrent status: #status#\r\n\r\nEnroled participants: #registered#\r\n\r\nRequired participants: #needed#\r\nReserve particpants: #reserve#','Die Registrierungszeit für die Session des folgenden Experimentes ist abgelaufen:\r\n\r\nName: #experiment_name#\r\nZeit: #session_name#\r\n\r\nDerzeitiger Status: #status#\r\n\r\nRegistrierte Teilnehmer: #registered#\r\n\r\nBenötigte Teilnehmer: #needed#\r\nReserve-Teilnehmer: #reserve#'),(140004,'y',-1,'mail','admin_session_reminder_notice','Session reminder emails were added to email queue for\r\n\r\nExperiment: #experiment_name#\r\nSession: #session_name#\r\nParticipants: #nr_participants#\r\n\r\n#disclaimer#\r\n','Session-Erinnerungs-Mails wurden zur Email-Warteschlange hinzugefügt für\r\n\r\nExperiment: #experiment_name#\r\nSession: #session_name#\r\nTeilnehmer: #nr_participants#\r\n\r\n#disclaimer#'),(140005,'y',-1,'mail','default_invitation_internet','Hello #fname# #lname#!\r\n\r\nWe would like to invite you to participate at an Internet experiment.\r\n\r\nThe experiment will run from #start_time# to #stop_time#!\r\n\r\nTo participate, please click on the following link:\r\n\r\n#link#\r\n\r\n','Hallo #fname# #lname#!\r\n\r\nHiermit möchten wir Sie zu einem Internet-Experiment einladen.\r\n\r\nDas Experiment wird vom #start_time# bis zum #stop_time# stattfinden.\r\n\r\nUm teilzunehmen, klicken Sie bitte auf den folgenden Link:\r\n\r\n#link#\r\n\r\n'),(140006,'y',-1,'mail','default_invitation_laboratory','Hello #fname# #lname#!\r\n\r\nWe would like to invite you to participate in an experiment. \r\n\r\nYou are eligible to enrol in one of the following sessions:\r\n\r\n#sessionlist#\r\n\r\nIf you would like to participate, this link will take you to the enrolment page:\r\n\r\n#link#\r\n\r\nThis experiment is expected to run for about ??? hours. Participants will receive the show-up payment plus additional money. The total participant payment varies from person to person, with a minimum of $??? (the show-up payment) and a maximum of $???.\r\n\r\nSome alternates will be recruited for this experiment. If you show up on time but we do not require your participation, you will receive the $??? show-up payment and can leave the laboratory immediately thereafter.\r\n\r\nThe No-Show Policy is in effect for this experiment. (Please see the FAQ on the recruiting site if you don\'t remember what this policy is.) So, please don\'t enroll unless you are confident that you can come for the whole time.\r\n\r\nWe hope to see you at one of these sessions!\r\n\r\nCheers,\r\nYour researchers','Hallo #fname# #lname#!\r\n\r\nHiermit möchten wir Sie zu einem neuen Experiment einladen.\r\n\r\nEs stehen die folgenden Termine zur Auswahl:\r\n#sessionlist#\r\n\r\nWenn Sie teilnehmen möchten, können Sie sich unter dem folgenden Link anmelden:\r\n\r\n#link#\r\n\r\nDieses Experiment wird ca. XX Stunden dauern. Teilnehmer erhalten einen Fixbetrag von EUR XX plus ihr Experimenteinkommen. Die Gesamtauszahlung variiert von Person zu Person, mit einer Mindestauszahlung von EUR XX (dem Fixbetrag) und einer Maximalauszahlung von EUR XX. \r\n\r\nFür dieses Experiment werden etwas mehr Teilnehmer eingeladen als benötigt. Wenn Sie rechtzeitig erscheinen, wir jedoch Ihre Teilnahme nicht mehr benötigen, dann erhalten Sie einen Fixbetrag von EUR XX für Ihr pünktliches Erscheinen und können das Labor sofort wieder verlassen.\r\n\r\nFür dieses Experiment gilt unsere Nichterscheinen-Regel (siehe FAQ auf Rekrutierungs-Website). Bitte melden Sie sich nur an wenn Sie sicher sind dass Sie erscheinen können.\r\n\r\nWir hoffen Sie bei einem unserer Experimente begrüßen zu dürfen.\r\n\r\nIhre Experimentatoren'),(140007,'y',-1,'mail','default_invitation_online-survey','Hello #fname# #lname#!\r\n\r\nWe would like to invite you to participate at an Internet experiment.\r\n\r\nThe experiment will run from #start_time# to #stop_time#!\r\n\r\nTo participate, please click on the following link:\r\n\r\n#link#\r\n','Hallo #fname# #lname#!\r\n\r\nHiermit möchten wir Sie zu einem Internet-Experiment einladen.\r\n\r\nDas Experiment wird vom #start_time# bis zum #stop_time# stattfinden.\r\n\r\nUm in diesem Zeitraum teilzunehmen, klicken Sie bitte auf den folgenden Link:\r\n\r\n#link#\r\n'),(140009,'y',-1,'mail','public_experiment_registration','Hello #fname# #lname#!\r\n\r\nThank you for enroling in the following experiment session:\r\n\r\nName: #experiment#\r\nDate and Time: #session#\r\nLaboratory: #lab_name#\r\nLab location:\r\n#lab_address#\r\n\r\nPlease make sure to arrive on time. Also, please remember to bring your university ID card so that we can verify your details before the experiment begins. (No one will be allowed to participate without this verification.)\r\n\r\nSee you at the experiment!\r\n\r\nCheers,\r\nYour researchers','Hallo #fname# #lname#!\r\n\r\nSie haben sich fuer das folgende Experiment angemeldet:\r\n\r\nName: #experiment#\r\nDatum und Zeit: #session#\r\nLabor: #lab_name#\r\nOrt:\r\n#lab_address#\r\n\r\n\r\nBitte erscheinen Sie pünktlich. Bitte stellen Sie sicher dass Sie ein Identifikationsdokument (Studentausweis, Ausweis) bei sich haben.\r\n\r\nVielen Dank und mit freundlichen Gruessen\r\n\r\nIhre Experimentatoren'),(140010,'y',-1,'mail','public_mail_footer','-------\r\nThis message was sent via the EconLab online recruitment system.\r\n\r\nYour enrolments: #enrolment_link#\r\nYour profile: #edit_link#\r\n\r\nFoobarLab - The Experimental Laboratory at Foobar University\r\nhttp://lab.foobar.edu\r\n\r\n-----','-------\r\nDiese E-Mail wurde an Sie automatisch aus dem Experiment-Teilnehmer-System verschickt.\r\n\r\nIhre Experimente: #enrolment_link#\r\nIhr Teilnehmerprofil: #edit_link#\r\n\r\nFoobarLab - Das Experimentallabor an der Foobar Universität\r\nhttp://lab.foobar.edu\r\n\r\n-----'),(130838,'y',-1,'lang','session_reminder_sent_at_time_specified','The session reminder email was sent out at the time specified on the session\'s properties page.','Die Session-Erinnerung wurde zu der Zeit gesendet, die auf der Session-Eigenschaftenseite angegeben wurde.'),(140014,'y',-1,'mail','public_session_reminder','Hello #fname# #lname#!\r\n\r\nThis is a quick reminder about the experiment for which you are enrolled:\r\n\r\nName: #experiment_name#\r\nDate: #session_date#\r\nLaboratory: #lab_name#\r\nLocation: \r\n#lab_address#\r\n\r\nPlease make sure to arrive on time. Also, please remember to bring your university ID card so that we can verify your details before the experiment begins. (No one will be allowed to participate without this verification.)\r\n\r\nSee you at the experiment!\r\n\r\nCheers,\r\nYour researchers','Hallo #fname# #lname#!\r\n\r\nDies ist nur eine Erinnerungs-Email.\r\n\r\nSie sind für das folgende Experiment angemeldet:\r\n\r\nName: #experiment_name#\r\nDatum: #session_date#\r\nLabor: #lab_name#\r\nAdresse: \r\n#lab_address#\r\n\r\nBitte kommen Sie pünktlich. Bitte stellen Sie sicher dass Sie ein Identifikationsdokument (Studentausweis, Ausweis) bei sich haben.\r\n\r\nVielen Dank\r\n\r\nIhre Experimentatoren'),(140015,'y',-1,'mail','public_system_registration','Hello #fname# #lname#!\r\n\r\nThank you for registering with the online recruitment system.  As the last step in this process, you must confirm your registration by following this link:\r\n\r\n#registration_link#\r\n\r\nAfter confirming your registration, you will receive email invitations when experiments for which you are eligible are scheduled.\r\n\r\nAt any time, you can modify your profile data by visiting the online recruiting site.  Your current profile data are listed at the end of this message.\r\n\r\nCheers,\r\nYour researchers\r\n\r\n\r\nYour profile data:\r\nFirstname: #fname#\r\nLastname: #lname#\r\nE-Mail-Address: #email#\r\nPhone number: #phone_number#\r\n\r\nYou will receive invitations for:\r\n#invitations#','Hallo #fname# #lname#!\r\n\r\nSie haben sich in der Experiment-Teilnehmer-Datenbank des FoobarLab an der Fakultät für Wirtschaftswissenschaften, Foobar Universität, EconTown registriert.\r\n\r\nUm Ihre Registrierung zu bestätigen, klicken Sie bitte auf den folgenden Link:\r\n\r\n#registration_link#\r\n\r\nMit freundlichen Grüssen\r\nIhre Experimentatoren\r\n\r\n\r\nIhre Daten:\r\nNachname: #lname#\r\nVorname: #fname#\r\nE-Mail-Adresse: #email#\r\nTelefon: #phone_number#\r\n\r\nSie erhalten Einladungen für:\r\n#invitations#'),(130616,'y',-1,'lang','participant_profile_form_template','Participant profile form template','Teilnehmerprofil-Formular'),(130260,'y',-1,'lang','edit_participant_profile_form_template','Edit participant profile template','Teilnehmerprofil-Formular bearbeiten'),(200000,'y',0,'profession','0','-','-'),(200001,'y',3,'profession','1030665783','House husband/Housewife','Hausmann/Hausfrau'),(200002,'y',4,'profession','1043798985','High school student','Schüler/in'),(200003,'y',1,'profession','1043799010','Apprentice','Auszubildende/r'),(200004,'y',2,'profession','1043799075','Employee','Angestellte/r'),(200005,'y',7,'profession','1043799123','Public employee','Angestellte/r im öff. Dienst'),(200006,'y',12,'profession','1043799177','Worker','Arbeiter/in'),(200007,'y',5,'profession','1043799210','Officer','Beamte/r'),(200008,'y',10,'profession','1043799260','Self-employed','Selbständig'),(200009,'y',9,'profession','1043799314','Retiree','Rentner/in'),(200010,'y',11,'profession','1043799349','Unemployed','Arbeitslos'),(200011,'y',6,'profession','1043799382','Ph.D. student','Doktorand'),(200012,'y',8,'profession','1043799402','Post-Doc','Post-Doc'),(210001,'y',-1,'public_content','contact','<center>\r\n<BR>\r\n<TABLE border=0>\r\n<TR><TD align=left>\r\nLIST YOUR CONTACT DETAILS HERE\r\n\r\n</TD></TR>\r\n</TABLE>\r\n\r\n</center>','<center>\r\n<BR>\r\n<TABLE border=0>\r\n<TR><TD align=left>\r\nFÜHREN SIE HIER IHRE KONTAKTDATEN AUF\r\n\r\n</TD></TR>\r\n</TABLE>\r\n\r\n</center>'),(210003,'y',-1,'public_content','impressum','<center>\r\n<BR><BR>\r\n<h4>Imprint (Legal Notice) - An example</h4>\r\n<BR>\r\n\r\n<TABLE width=100%>\r\n<TR><TD>\r\n\r\n<B>Provider</B><BR><BR>\r\nProvider of this website is Department of Economics of Foobar University.\r\n<BR><BR>\r\n</TD></TR>\r\n<TR><TD>\r\n<TABLE width=100%>\r\n<TR><TD valign=top>\r\n      Address:\r\n</TD><TD>\r\n       