mith.\r\n<BR><BR>\r\n<B>Redaktionsverantwortliche(r)</B><BR>\r\nRedaktionsverantwortliche(r) für die Internetpräsenz der Fakultät für Wirtschaftswissenschaften ist:\r\nJohn Doe <BR><BR>\r\n\r\n<B>Rechtliche Hinweise zur Organisationsform</B><BR>\r\nDie Fakultät für Wirtschaftswissenschaften ist eine gemeinnützige Forschungseinrichtung .... <BR><BR>\r\n\r\n<B>Rechtliche Hinweise zur Haftung / Disclaimer</B><BR>\r\nDie Fakultät für Wirtschaftswissenschaften ist um Richtigkeit und Aktualität der auf dieser Internetpräsenz bereitgestellten Informationen bemüht.\r\nTrotzdem können Fehler und Unklarheiten nicht vollständig ausgeschlossen werden. Die Fakultät für Wirtschaftswissenschaften übernimmt deshalb\r\nkeine Gewähr für die Aktualität, Richtigkeit, Vollständigkeit oder Qualität der bereitgestellten Informationen. Für Schäden materieller oder\r\nimmaterieller Art. die durch die Nutzung oder Nichtnutzung der dargebotenen Informationen bzw. durch die Nutzung fehlerhafter und\r\nunvollständiger Informationen unmittelbar oder mittelbar verursacht werden, haftet die Fakultät für Wirtschaftswissenschaften nicht, sofern ihr nicht\r\nnachweislich vorsätzliches oder grob fahrlässiges Verschulden zur Last fällt. Gleiches gilt für kostenlos zum Download bereitgehaltene\r\nSoftware. Die Fakultät für Wirtschaftswissenschaften behält es sich vor, Teile des Internetangebots oder das gesamte Angebot ohne gesonderte\r\nAnkündigung zu verändern, zu ergänzen, zu löschen oder die Veröffentlichung zeitweise oder endgültig einzustellen.\r\n<BR><BR>\r\nDie Verantwortlichkeit für \"fremde Inhalte\", die beispielsweise durch direkte oder indirekte Verknüpfungen (z.B. sogenannte \"Links\") zu\r\nanderen Anbietern bereitgehalten werden, setzt unter anderem positive Kenntnis des rechtswidrigen bzw. strafbaren Inhaltes voraus.\r\n\"Fremde Inhalte\" sind in geeigneter Weise gekennzeichnet. Die Fakultät für Wirtschaftswissenschaften hat auf \"fremde Inhalte\" keinerlei Einfluss und\r\nmacht sich diese Inhalte auch nicht zu Eigen. Die Fakultät für Wirtschaftswissenschaften hat keine positive Kenntnis über rechtswidrige oder anstößige\r\nInhalte auf den verknüpften Seiten fremder Anbieter. Sollten auf den verknüpften Seiten fremder Anbietet dennoch rechtswidrige oder\r\nanstößige Inhalte enthalten sein, so distanziert sich die Fakultät für Wirtschaftswissenschaften von diesen Inhalten ausdrücklich.\r\n<BR><BR>\r\n<B>Rechtliche Hinweise zum Urheberrecht</B><BR>\r\nDas Layout der Homepage, die verwendeten Grafiken sowie die sonstigen Inhalte sind urheberrechtlich geschützt.\r\n<BR><bR>\r\n© Fakultät für Wirtschaftswissenschaften, Foobar-Universitätm EconTown, Wonderland. Alle Rechte vorbehalten\r\n\r\n</TD></TR></TABLE>\r\n</center>'),(130180,'y',-1,'lang','delete_admin','Delete administrator','Administrator löschen'),(130032,'y',-1,'lang','admin_deleted','Admin deleted','Administrator gelöscht'),(130640,'y',-1,'lang','password_changed','Password changed.','Passwort geändert.'),(130465,'y',-1,'lang','is_experimenter','Is experimenter?','Ist Experimentator?'),(131010,'y',-1,'lang','y','yes','ja'),(130551,'y',-1,'lang','n','no','nein'),(210004,'y',-1,'public_content','mainpage_welcome','<BR><BR><h4>Welcome to the Recruitment Site for the Experimental Laboratory at Foobar University (FoobarLab)</h4>\r\n<BR><BR>\r\n<TABLE width=60%>\r\n<TR><TD>\r\n\r\n<P>On this site, you can express your interest in receiving invitations to participate in human-subjects experiments at the FoobarLab.  The lab facility is located on our EconTown campus, in the Economics building.\r\n\r\n<P>The first step in the registration process is to <a href=\"participant_create.php\">register</a> in our database. This step does not commit you to participate in any particular experiment, but you will receive email notifications about upcoming experiments when they are scheduled.\r\n\r\n<P>Additional information about participating in experiments can be found in the <a href=\"faq.php\">FAQ</a>.\r\n\r\n<P>If you have already registered in a subject pool, you can view the available experiment times in the <a href=\"show_calendar.php\">calendar</a>.\r\n\r\n</TD></TR></TABLE>\r\n<BR>\r\n<BR>','<BR><BR>\r\n<h4>Willkommen beim Rekrutierungssystem</h4><BR>\r\ndes Experimentallabors der Foobar-Universität (FoobarLab) \r\n<BR><BR>\r\n<TABLE width=60%>\r\n<TR><TD>\r\n<P>Auf dieser Seite können Sie sich für Laborexperimente am FoobarLab in EconTown als auch für Internetexperimente anmelden. \r\n\r\n<P>Der erste Schritt des Anmeldeprozesses ist sich in unserer Datenbank zu <a href=\"participant_create.php\">registrieren</a>. Dieser Schritt verpflichtet Sie erstmal zu nichts, Sie werden lediglich Email-Einladungen zu bestimmten aktuellen Experimenten erhalten für die Sie sich dann anmelden können wenn Sie das möchten.\r\n\r\n<P>Zusätzliche Informationen über Experimentteilnahmen finden Sie in unseren <a href=\"faq.php\">FAQs</a>.\r\n\r\n</TD></TR></TABLE>\r\n<BR>\r\n<BR>'),(210005,'y',-1,'public_content','privacy_policy','<P>The Experimental Laboratory of Foobar University (FoobarLab) is bound by the <B>Foobar Code for the Responsible Conduct of Research.</B>.\r\n\r\n<P> FoobarLab\'s research-ethics responsibilities include the proper safeguarding of potentially sensitive data collected during an experiment.  FoobarLab takes the following steps to meet its confidentiality requirements:\r\n\r\n<UL>\r\n<LI>All data collected during <b>recruitment</b> is stored on a server that is accessible only to FoobarLab research staff. These data are used only for the purpose of recruiting subjects to participate in FoobarLab experiments.</LI>\r\n<LI>All personally-identifying data collected during an <b>experiment</b> (e.g., your name) is processed according to the approved ethics document of the respective study. Usually, any personal information is replaced with a code number, and the list linking code numbers to personally-identifying data is kept separate from the experimental data. </LI>\r\n<LI>All human-subjects <b>forms</b> containing personally-identifying information (e.g., informed consent) are stored in secure locations.</LI>\r\n</UL>\r\n\r\n<P>As a human-subject participant at FoobarLab, it is your right to lodge a complaint if you believe that sensitive information about you collected during an experiment has not actually been kept confidential.  Such complaints can be delivered to the Ethics Secretariat, Foobar University.','Teilnehmerdatenbank<BR>\r\n<UL>\r\n<LI>Die im sogenannten \"Recruitment System\" des FoobarLab erfassten Daten dienen ausschliesslich der Organisation von wissenschaftlichen Experimenten. Diese Daten werden nicht an Dritte weitergegeben. Wir benutzen die Daten zu den folgenden Zwecken:\r\n<UL>\r\n<LI>um die Teilnehmer über neue Labor- oder Internetexperimente zu informieren und dazu einzuladen</LI>\r\n<LI>um eine wissenschaftlich motivierte Auswahl von Teilnehmern für bestimmte Experimente durchzuführen</LI>\r\n<LI>um das Erscheinen bzw. Nicht-Erscheinen der angemeldeten Teilnehmer bei Experimenten zu überprüfen</LI>\r\n</UL></LI>\r\n<LI>Jeder Teilnehmer kann jederzeit bestimmen, dass er keine weiteren Einladungen zu Experimenten erhalten will.</LI>\r\n<LI>Auf Verlangen eines Teilnehmer werden seine erfassten Daten uneingeschränkt gelöscht. Hierfür ist eine formlose schriftliche und unterschriebene Löschungsaufforderung zu schicken an die Fakultät für Wirtschaftswissenschaften, Foobar-Universität, Recruitment System, Adam-Smith-Str. 4, 12345 EconTown, Wonderland.</LI>\r\n</UL>\r\n<BR>\r\nExperimente<BR>\r\n<UL>\r\n<LI>Bei der Durchführung von Experimenten werden durch die dabei zu treffenden Entscheidungen der Teilnehmer Daten generiert.</LI>\r\n<LI>Diese Daten werden wissenschaftlich durch die Fakultät für Wirtschaftswissenschaften ausgewertet. Dabei werden die Entscheidungsdaten anonymisiert und können keiner Person zugeordnet werden. Die Teilnahme an den Experimenten ist in diesem Sinne anonym.</LI>\r\n<LI>Die generierten, anonymisierten Daten werden für die Erstellung von wissenschaftlichen Forschungsarbeiten und Vorträgen benutzt. Diese Arbeiten werden veröffentlicht.</LI>\r\n</UL>\r\n<BR>\r\nVideoexperimente<BR>\r\n<UL>\r\n<LI>Bei der Durchführung von Videoexperimenten werden von den Teilnehmern Ton und Bildaufzeichungen erstellt. Die Videodaten werden wissenschaftlich durch die Fakultät für Wirtschaftswissenschaften ausgewertet. Insbesondere werden Transskripte der Konversation erstellt. Die Fakultät für Wirtschaftswissenschaften erhält das Recht, ausgewählte Sequenzen im Rahmen von Präsentationen zu publizieren.</LI>\r\n<LI>Diese Aufzeichnungen werden anonymisiert und können bei der Auswertung nicht den persönlichen Daten der Teilnehmer zugeordnet werden.</LI>\r\n</UL>'),(210006,'y',-1,'public_content','rules','<P>In order to participate in experiments at the Foobar University Experimental Laboratory (FoobarLab), you must register in our database using the lab\'s online recruitment system. Part of this registration process involves acknowledging the following basic rules of conduct:\r\n\r\n<UL>\r\n\r\n<LI>You can only register once in the ORSEE database. Registering multiple accounts undermines our scientific research. Any participant found with more than one profile will be excluded from all future studies.</LI>\r\n\r\n<LI>Only current students at Foobar University are eligible to participate in Foobar experiments. You must bring your unexpired Foobar University ID card to each session, so that FoobarLab researchers can verify your status.</LI>\r\n\r\n<LI>A certain number of registered persons will receive an invitation email to each experiment. The exact number is determined by the researcher conducting that experiment. Only the invited persons may take part in that experiment.</LI>\r\n\r\n<LI>If you receive an invitation email, you must respond affirmatively in order to participate. Spaces in an experiment are limited, so it is important to respond early to better ensure that a space will still be available. <b>Important Note: Once you respond affirmatively, you cannot later withdraw this response from the recruitment system, so please verify that you are actually able to come before you respond.</b></LI>\r\n\r\n<LI>Usually, some extra persons are invited to ensure that a minimum participation level is achieved. Alternates will receive compensation for arriving for the experiment on time. The exact amount of this payment is determined by the researcher conducting that particular experiment, and will be described in the invitation email.</LI>\r\n\r\n<LI>Participants will usually be compensated based on the decisions they make during the experiment. The exact amount of this payment is determined by the researcher conducting that particular experiment, and will be described in the invitation email. </LI>\r\n\r\n<LI><b>Important Note: After the scheduled start time, anyone who responded affirmatively to an invitation but did not show up will not receive any compensation for that experiment. In addition, he or she will be charged with a \"no-show penalty.\" After a person receives 2 no-show penalties, he or she will be permanently removed from the database, and will be ineligible for any further experiments.</b></LI>\r\n\r\n<LI>During an experiment, Participants must follow the directives of the researchers. The researchers will identify themselves before the commencement of the experiment.</LI>\r\n\r\n</UL>','Laborexperimente<BR><BR>\r\n\r\nUm an Experimenten teilzunehmen, die von Wissenschaftlern des FoobarLab an der Fakultät für Wirtschaftswissenschaften, Foobar-Universitaäät, EconTown durchgeführt werden, müssen Sie sich online registrieren (http://orsee.foobar.edu) und ein unterschriebenes Exemplar dieses Formulars der Fakultät zur Verfügung stellen. Die Unterschrift kann auch bei der Teilnahme an dem ersten Experiment nach Registrierung geleistet werden.<BR><BR>Die Registrierung für Laborexperimente ist eine Absichtserklärung zur Teilnahme an den von den Wissenschaftlern der Fakultät durchgeführten Experimenten.<BR><BR>\r\n\r\nRegeln für Laborexperimente\r\n<UL>\r\n<LI>Für jedes Experiment erhält eine bestimmte Zahl registrierter Personen eine Einladung per E-mail. Nur eingeladene Personen sind zur Teilnahme am Experiment berechtigt.</LI>\r\n<LI>Nach Erhalt einer Einladung per E-Mail zu einem bestimmten Experiment muss eine positive Rückantwort durch den Teilnehmer erfolgen, um bei diesem Experiment angemeldet zu sein. Diese Antwort ist eine verbindliche Zusage, an diesem Experiment teilzunehmen.</LI>\r\n<LI>Für jedes Experiment werden mehr Teilnehmer eingeladen als benötigt. Es nehmen diejenigen am Experiment teil, die zuerst im Labor erscheinen. Teilnehmer, die eingeladen wurden und rechtzeitig anwesend sind, aber aus Kapazitäts- bzw. anderen Gründen nicht teilnehmen können, erhalten für ihr Erscheinen eine Entschädigung.</LI>\r\n<LI>Jeder für ein Experiment eingeladene und rechtzeitig anwesende Teilnehmer erhält zumindest eine Entschädigungszahlung von EUR 2,50.</LI>\r\n<LI>Die Teilnehmer werden üblicherweise bar bezahlt. Die Höhe des ausgezahlten Betrages hängt von den eigenen Entscheidungen bzw. von den Entscheidungen der anderen Experimentteilnehmer ab.</LI>\r\n<LI>Während eines Experiments muss sich jeder Teilnehmer an die von den Experimentatoren in den Instruktionen festgelegten Regeln halten.</LI>\r\n<LI>Um sicherzustellen, dass nur eingeladene und ordnungsgemäß per E-mail angemeldete Teilnehmer am Experiment teilnehmen, muss sich jeder Teilnehmer ausweisen (Dokument mit Bild). Kann sich ein Teilnehmer nicht ausweisen, erhält er keine Entschädigung für sein Erscheinen und kann eventuell auch nicht am Experiment teilnehmen.</LI>\r\n<LI>Teilnehmer, die ihre Bereitschaft zur Teilnahme an einem bestimmten Experiment erklärt haben und nicht bzw. zu spät erscheinen, müssen sich der Tatsache bewusst sein, dass sie damit die Durchführung des Experiments wegen Mangel an Teilnehmern gefährden. </LI>\r\n</UL><BR>\r\nMit Ihrer Anmeldung für Laborexperimente erklären Sie sich mit folgenden Aussagen einverstanden:<BR><BR>\r\nIch bin darüber informiert worden, dass mein Nichterscheinen bzw. mein zu spätes Erscheinen zum Experiment, für dass ich mich angemeldet habe, zur Absage des Experiments führen kann. Ich bin mir bewusst, dass ich für Kosten, die durch abgesagte Experimente entstehen, haftbar gemacht werden kann, wenn ich der Fakultät nicht mindestens 24 Stunden vor Durchführung des Experiments über meine Nichtteilnahme informiere bzw. nicht erklären bzw. belegen kann, weshalb eine rechtzeitige Information der Fakultät bzw. rechtzeitiges Erscheinen nicht möglich war.<BR><BR>\r\nBei jedem Nichterscheinen nach Anmeldung für ein Experiment - ohne rechtzeitige Absage bei dem Experimentverantwortlichen oder Angabe von plausiblen Gründen - erhält das persönliche Konto des Teilnehmers einen Minuspunkt (siehe Personendaten auf der Web-Site nach der online Anmeldung). Je mehr Minuspunkte ein Teilnehmer hat, umso geringer sind seine Chancen, für weitere Experimente eingeladen zu werden. Sobald das Konto eines Teilnehmers drei Minuspunkte enthält, wird er nicht wieder zu einem am FoobarLab durchgeführten Experiment eingeladen. <BR><BR>\r\nDer Versicherungsschutz in den Räumen des FoobarLab besteht bezüglich der gesetzlichen Haftpflicht privatrechtlichen Inhalts. Die Fakultät für Wirtschaftswissenschaften haftet für alle Schäden, die vom FoobarLab zu vertreten sind. Eine verschuldensunabhängige Haftung besteht nicht.<BR><BR>\r\nInternetexperimente<BR><BR>\r\nDie Regeln für Internetexperimente werden auf der Registrierungs-Seite des jeweiligen Experimentes beschrieben.'),(130236,'y',-1,'lang','edit_budget','Edit budget','Budget bearbeiten'),(130327,'y',-1,'lang','error_language_shortcut_must_be_two_latin_letters','The language shortcut must consist of two lower-case latin letters.','Das Kürzel für die Sprache muss aus zwei kleingeschriebenen lateinischen Buchstaben bestehen.'),(130611,'y',-1,'lang','participant_id','Participant ID','Teilnehmer-ID'),(130652,'y',-1,'lang','payment_type','Payment type','Auszahlungs-Typ'),(220000,'y',-1,'subjectpool','1','',''),(130769,'y',-1,'lang','replace_experimenttype_with','Replace this experiment type in participant subscriptions and experiment properties with the experiment type','Ersetze diesen Experimenttyp in den Abonnements der Teilnehmer und den Eigenschaften der Experimente mit dem Experimenttype'),(130005,'y',-1,'lang','action','Action','Aktion'),(130010,'y',-1,'lang','add','Add','Hinzufügen'),(130013,'y',-1,'lang','add_default_mail','Add e-mail template','E-Mail-Vorlage hinzufügen'),(130014,'y',-1,'lang','add_default_text','Add default text','Textvorlage hinzufügen'),(130018,'y',-1,'lang','add_faq','Add FAQ','FAQ hinzufügen'),(130019,'y',-1,'lang','add_field_of_studies','Add field of studies','Studienfach hinzufügen'),(130020,'y',-1,'lang','add_help','Add help','Hilfe hinzufügen'),(130021,'y',-1,'lang','add_language','Add language','Sprache hinzufügen'),(130023,'y',-1,'lang','add_participant','Add participant','Teilnehmer hinzufügen'),(130024,'y',-1,'lang','add_profession','Add profession','Beruf hinzufügen'),(130025,'y',-1,'lang','add_public_content','Add public content','Öffentliche Inhalte hinzufügen'),(130027,'y',-1,'lang','add_symbol','Add symbol','Symbol hinzufügen'),(130030,'y',-1,'lang','admin_area','Admin Area','Admin-Bereich'),(130033,'y',-1,'lang','admin_login_page','Admin login page','Admin Anmeldeseite'),(130040,'y',-1,'lang','already_confirmed_error','You have already confirmed your registration!','Sie haben Ihre Registrierung bereits bestätigt!'),(130041,'y',-1,'lang','already_registered_but_not_confirmed','You have already registered, but not yet confirmed your registration.','Sie sind bereits registriert, haben Ihre Registrierung aber noch nicht bestätigt.'),(130042,'y',-1,'lang','and','AND','UND'),(130043,'y',-1,'lang','answer','Answer','Antwort'),(1300